function main() {
    // Add listeners
    const solve_button = document.getElementById("solve");
    solve_button.addEventListener("click", solve_and_show);
}

function ordered_string_match(small, big) {
    small = Array.from(small).sort();
    big = Array.from(big).sort();

    let i = 0,
        j = 0;
    while (true) {
        if (i >= small.length) {
            return true;
        }
        if (j >= big.length) {
            return false;
        }
        if (small[i] === big[j]) {
            i++;
            j++;
            continue;
        }
        if (small[i] < big[j]) {
            return false;
        }
        if (small[i] > big[j]) {
            j++;
        }
    }
}

function solve_game() {
    selection = document.getElementById("rack").textContent;
    selection = selection.split(" ").join(""); // remove spaces

    wordlist = get_wordlist();

    let matches = [];
    wordlist.forEach((w) => {
        if (ordered_string_match(w, selection)) {
            matches.push(w);
        }
    });

    console.log(matches);
    return matches;
}

function show_solution(answers, n_to_show) {
    answers = answers.slice(0, n_to_show);
    console.log(answers);

    annotated_answers = [];
    answers.forEach((x) => annotated_answers.push(x.length + " " + x));
    console.log(annotated_answers);

    annotated_answers = annotated_answers.join("<br />");
    const solutions = document.getElementById("solutions");
    solutions.innerHTML = annotated_answers;
}

function solve_and_show() {
    n_to_show = 10;
    answers = solve_game();
    show_solution(answers, n_to_show);
    document.getElementById("generate").focus();
}

